import Header from './Header.js';
import './Header.css';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom';
import HeroContainer from './HeroContainer.js';


const Presentational = () => {
  return (
    <div>
        <Header />
        <HeroContainer />
    </div>
  )
}

export default Presentational
